import { Chart, Tooltip, Axis, Legend, Bar, Line} from "viser-react";
import * as React from "react";
import BankPersonal from "./Reactjs";

class ChartHistoryGroupColumn extends React.Component {
  constructor(props) {
    super(props);
    this.state = {

      selectedKey: "daily"
    };
  }
  render() {

    return (

       <BankPersonal  data={this.state.selectedKey}/>

    );
  }
}
export default ChartHistoryGroupColumn;
